import React from 'react';
import PropTypes from 'prop-types';

PostList.propTypes = {
  posts: PropTypes.array,
};
PostList.defaultProps = {
  posts: [],
}
function PostList(props) {
  const {posts} = props;
  return (
    <div>
      <ul className="post-list">
        {posts.map(post=>(
          <li key = {post.id}>{post.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default PostList;
